import{_ as o,c as a,o as i,ae as c}from"./chunks/framework.Dh1jimFm.js";const t="/6dd42026a91c405d024d096c3c2b4bf1.png",r="/178bd025a73efa5c7baa5b7c83f4c80b.png",l="/67733724f2d5db55403bd7736f9d086b.png",d="/db9399e8f5456477b87eb990f088bd85.png",n="/9495afa5b843b15a2220101aa31d3e0e.png",s="/9e0a0571ad6e6aa905e6e0807062d8c7.png",p="/9db98cc88f05aecb1eddeb7463ee1f1a.png",b="/04563c906701e8bdb2ca9080abf1ddf3.png",f="/2bcea57f1b869e4c15b8f83962d0a615.png",g="/df2beb27952e0523390419952b1ab0a1.png",h="/c8dcbaf52bc205fff1339c8dcc6db829.png",m="/d22afd2ebf6dad0fddb9dd6a1072f4a4.png",_="/b77c0ab01a0cdc07f5e4a03c307fb52d.png",u="/WechatIMG424.jpg",k="/4066755b24c74d5bd73a47883a65d6f9.png",A="/5a94bb398b6a8d20542a52ef1447cb37.png",C="/9e82c16b4b009c5449e47d9afb67d79b.png",G="/e36e1bac4c24d9ea5d3ddd3916c20797.png",T="/f97c554473195e7f631f5eae2fd66a1a.png",q="/9dbbf62375f48abca61eee3e17e2a9b2.png",P="/8aa28c66fb4fb024caeaba745c214e35.png",S="/9354f5b0a03de472665fe60e8328d3f2.png",x="/f5970918ab11951dde25544b535d0696.png",I="/5a00f7e7258748beeb20886c1dad3362.png",v="/3cc1675d827a0539380a45083f9e2651.png",N="/abf52effa01de5bb5ed09bc9f9642d37.png",w="/fc24a8dce3c2e90abe4af46a037b115d.png",D=JSON.parse('{"title":"Token 提取","description":"","frontmatter":{},"headers":[],"relativePath":"others/extract-token.md","filePath":"others/extract-token.md","lastUpdated":1771563132000}'),O={name:"others/extract-token.md"};function E(R,e,y,B,W,K){return i(),a("div",null,e[0]||(e[0]=[c('<h1 id="token-提取" tabindex="-1">Token 提取 <a class="header-anchor" href="#token-提取" aria-label="Permalink to &quot;Token 提取&quot;">​</a></h1><h2 id="openai" tabindex="-1">OpenAI <a class="header-anchor" href="#openai" aria-label="Permalink to &quot;OpenAI&quot;">​</a></h2><p>OpenAI 平台有 <code>ChatGPT</code>、<code>Sora</code>、<code>Codex</code>三个平台，都可以通过以下三种 Token 进行加号</p><ul><li><p><code>AccessToken</code>：</p><ol><li>一般 <code>10天</code> 过期，一旦过期 Token 就变异常</li><li>打开官网控制台，随便抓取一个接口的 <code>Authorization</code> 头便是 <code>AccessToken</code></li></ol><p><img src="'+t+'" alt=""></p></li><li><p><code>RefreshCookie</code>：</p><ol><li>一般不会过期，除非手动点击退出所有设备或退出登陆</li><li>多号取的时候记得使用无痕浏览器登陆，取了之后直接关闭浏览器即可，无需点击退出登陆</li><li>打开官网控制台，在 Cookie 中找到一个名为 <code>__Secure-next-auth.session-token</code> 便是 <code>RefreshCookie</code></li></ol><p><img src="'+r+'" alt=""></p></li><li><p><code>RefreshToken</code>：</p><ol><li>以 <code>rt_</code> 开头，由 OpenAI 的 <code>OAuth2</code> 颁发，一般用于刷新 <code>AccessToken</code></li><li>一般不会过期，除非官方封控、账号改密码或账号被封才会失效</li><li>目前只有号商那边才有提供，自己提取难度很大，需要自己有能力或抓包 <strong>苹果 IOS</strong> 接口</li></ol></li></ul><h2 id="cursor" tabindex="-1">Cursor <a class="header-anchor" href="#cursor" aria-label="Permalink to &quot;Cursor&quot;">​</a></h2><p>打开 <a href="https://cursor.com/" target="_blank" rel="noreferrer">Cursor 官网</a> 控制台，在 <code>Cookie</code> 中找到一个名为 <code>WorkosCursorSessionToken</code></p><p><img src="'+l+'" alt=""></p><h2 id="kiro" tabindex="-1">Kiro <a class="header-anchor" href="#kiro" aria-label="Permalink to &quot;Kiro&quot;">​</a></h2><p>打开 <a href="https://app.kiro.dev/" target="_blank" rel="noreferrer">Kiro 官网</a> 的开发者控制台，在<strong>登录后</strong>抓取一个后缀为 <code>ExchangeToken</code> 的接口，在 <code>Set-Cookie</code> 中找到 <code>RefreshToken</code></p><p><img src="'+d+'" alt=""></p><h2 id="grok" tabindex="-1">Grok <a class="header-anchor" href="#grok" aria-label="Permalink to &quot;Grok&quot;">​</a></h2><p>打开 <a href="https://grok.com/" target="_blank" rel="noreferrer">Grok 官网</a> 控制台，在 <code>Cookie</code> 中找到一个名为 <code>sso</code></p><p><img src="'+n+'" alt=""></p><h2 id="anthropic" tabindex="-1">Anthropic <a class="header-anchor" href="#anthropic" aria-label="Permalink to &quot;Anthropic&quot;">​</a></h2><p>Anthropic 平台有 <code>Claude官网</code>、<code>Claude Code</code>两个平台，都需要打开 <a href="https://claude.ai/" target="_blank" rel="noreferrer">Claude 官网</a> 控制台，在 <code>Cookie</code> 中找到一个名为 <code>sessionKey</code></p><p><img src="'+s+'" alt=""></p><h2 id="google" tabindex="-1">Google <a class="header-anchor" href="#google" aria-label="Permalink to &quot;Google&quot;">​</a></h2><h3 id="插件安装" tabindex="-1">插件安装 <a class="header-anchor" href="#插件安装" aria-label="Permalink to &quot;插件安装&quot;">​</a></h3><ul><li><p>在后台插件管理中安装插件然后解压</p><p><img src="'+p+'" alt="0edeffcf5a473a31361bb8e0a77b9189.png"></p></li><li><p>在谷歌浏览器的插件管理中导入解压的文件夹</p><p><img src="'+b+'" alt="04563c906701e8bdb2ca9080abf1ddf3.png"></p><p><img src="'+f+'" alt="2bcea57f1b869e4c15b8f83962d0a615.png"></p><p><img src="'+g+'" alt="df2beb27952e0523390419952b1ab0a1.png"></p><p><img src="'+h+'" alt=""></p><p><img src="'+m+'" alt=""></p></li></ul><h3 id="gemini-api" tabindex="-1">Gemini API <a class="header-anchor" href="#gemini-api" aria-label="Permalink to &quot;Gemini API&quot;">​</a></h3><p>打开 <a href="https://aistudio.google.com/" target="_blank" rel="noreferrer">Gemini AiStudio</a> 控制台，点击底部的 <code>Get API Key</code> 然后创建或查询已存在的 API KEY</p><p><img src="'+_+'" alt=""></p><h3 id="gemini-官网" tabindex="-1">Gemini 官网 <a class="header-anchor" href="#gemini-官网" aria-label="Permalink to &quot;Gemini 官网&quot;">​</a></h3><div class="warning custom-block github-alert"><p class="custom-block-title">WARNING</p><p></p><ul><li>提取之前如果已登录过，<strong>一定要退出重新登录</strong>，提取之后马上加入 tokens 号池中，否则很快会失效</li><li>建议使用无痕浏览器提取，提取完之后，页面不要进行任何对话等<strong>点击操作</strong>，马上关闭浏览器或网页，否则很快会失效</li></ul></div><p>打开 <a href="https://gemini.google.com/" target="_blank" rel="noreferrer">Gemini 官网</a> 控制台，在 <code>Cookie</code> 中找到一个名为 <code>__Secure-1PSID</code></p><p><img src="'+u+'" alt=""></p><h3 id="flow" tabindex="-1">Flow <a class="header-anchor" href="#flow" aria-label="Permalink to &quot;Flow&quot;">​</a></h3><div class="warning custom-block github-alert"><p class="custom-block-title">WARNING</p><p></p><p>全程加号必须在谷歌的<strong>无痕浏览器</strong>中进行，请确保在插件详情中打开【在无痕模式下启用】选项</p></div><ul><li><p>先 <a href="#插件安装">按照这里</a> 的步骤安装好插件，然后返回插件管理刷新页面</p></li><li><p>点击 <code>添加Flow平台Token</code> 按钮</p><p><img src="'+k+'" alt=""></p></li><li><p>登陆谷歌账号，<code>登陆成功</code> 后会自动返回到 <code>tokens管理</code> 中并且自动添加到号池中</p><p><img src="'+A+'" alt="5a94bb398b6a8d20542a52ef1447cb37.png"></p><p><img src="'+C+'" alt="9e82c16b4b009c5449e47d9afb67d79b.png"></p></li></ul><h3 id="gemini-cli" tabindex="-1">Gemini CLI <a class="header-anchor" href="#gemini-cli" aria-label="Permalink to &quot;Gemini CLI&quot;">​</a></h3><div class="warning custom-block github-alert"><p class="custom-block-title">WARNING</p><p></p><ul><li>程序自动创建 <code>Google Cloud</code> 项目，并开启 <code>Gemini for Google Cloud API</code> 能力</li></ul></div><ul><li><p>先 <a href="#插件安装">按照这里</a> 的步骤安装好插件，然后返回插件管理刷新页面</p></li><li><p>点击 <code>添加Gemini Cli平台的Token</code> 按钮</p><p><img src="'+G+'" alt="5e3620f58fe5e805ac08413e7eab75f2.png"></p></li><li><p>登陆谷歌账号，<code>登陆成功</code> 后会自动返回到 <code>tokens管理</code> 中并且自动添加到号池中</p><p><img src="'+T+'" alt="f97c554473195e7f631f5eae2fd66a1a.png"></p><p><img src="'+q+'" alt="9dbbf62375f48abca61eee3e17e2a9b2.png"></p></li></ul><h3 id="antigravity" tabindex="-1">Antigravity <a class="header-anchor" href="#antigravity" aria-label="Permalink to &quot;Antigravity&quot;">​</a></h3><ol><li><p><code>refresh_token</code> 方式添加：</p><ul><li>在 Token 管理页面的添加 Token 中选择 Antigravity 平台，一行一个 <code>refresh_token</code></li><li>需要确保 <code>refresh_token</code> 是由回调地址 <code>http://localhost:1024/oauth-callback</code> 生成的，不然其他回调地址生成的 <code>refresh_token</code> 无法加入到号池内</li></ul></li><li><p>插件添加：</p><ul><li><p>先 <a href="#插件安装">按照这里</a> 的步骤安装好插件，然后返回插件管理刷新页面</p></li><li><p>点击 <code>添加Antigravity平台的Token</code> 按钮</p><p><img src="'+P+'" alt="5e3620f58fe5e805ac08413e7eab75f2.png"></p></li><li><p>登陆谷歌账号，<code>登陆成功</code> 后会自动返回到 <code>tokens管理</code> 中并且自动添加到号池中</p><p><img src="'+S+'" alt="f97c554473195e7f631f5eae2fd66a1a.png"></p><p><img src="'+x+'" alt="9dbbf62375f48abca61eee3e17e2a9b2.png"></p></li></ul></li></ol><h3 id="gemini-business" tabindex="-1">Gemini Business <a class="header-anchor" href="#gemini-business" aria-label="Permalink to &quot;Gemini Business&quot;">​</a></h3><div class="warning custom-block github-alert"><p class="custom-block-title">WARNING</p><p></p><p>目前 Gemini Business 平台的 Token 有效期是 12 个小时，过期后需重新提取</p></div><ol><li><p><code>cookies</code> 方式添加：</p><ul><li>在 Token 管理页面的添加 Token 中选择 Gemini Business 平台，一行一个 <code>cookies</code></li><li>提取 <code>auth.business.gemini.google</code> 域名下的 <code>__Host-C_OSES</code> 和 <code>__Secure-C_SES</code></li><li>使用 <code>::</code> 拼接这两个值，格式为：<code>__Host-C_OSES的值::__Secure-C_SES的值</code></li><li>例如：<code>COS.AW82PoG......::CSE.AdwtfT......</code></li></ul><p><img src="'+I+'" alt=""></p></li><li><p>插件添加：</p><ul><li><p>先 <a href="#插件安装">按照这里</a> 的步骤安装好插件，然后返回插件管理刷新页面</p></li><li><p>点击 <code>添加Gemini Business平台的Token</code> 按钮</p><p><img src="'+v+'" alt=""></p></li><li><p>登陆 Gemini Business 账号，<code>登陆成功</code> 后会自动返回到 <code>tokens管理</code> 中并且自动添加到号池中</p><p><img src="'+N+'" alt=""></p><p><img src="'+w+'" alt=""></p></li></ul></li></ol>',37)]))}const F=o(O,[["render",E]]);export{D as __pageData,F as default};
